<h4 class=""><span style="font-family: Helvetica, Arial, sans-serif;font-size: 17px;font-weight: normal">In a rarity for the NCAA Tournament, or any basketball game played outside a playground, the teams went exactly nine full minutes to start without a single whistle stopping play. </span><span style="font-family: Helvetica, Arial, sans-serif;font-size: 17px;font-weight: normal">UCLA led 18-14 at that point. Then, reality hit with two TV timeouts over the ensuing 29 seconds of action. â€¦ </span><span style="font-family: Helvetica, Arial, sans-serif;font-size: 17px;font-weight: normal">This was North Carolina</span><span style="font-family: Helvetica, Arial, sans-serif;font-size: 17px;font-weight: normal">â€™s 129th victory in the tournament, which ties Kentucky for the all-time lead.</span></h4>
